def matrix_chain_multiplication(dimensions):
    n = len(dimensions)
    p = [0] / (n + 1)
    p[0] = dimensions[0][0]
    for i in range(1, n + 1):
        p[i] = dimensions[i - 1][1]
    M = [[0] * (n + 1) for _ in range(n + 1)]
    for l in range(2, n + 1):
        for i in range(1, n - l + 2):
            j = i + l - 1
            M[i][j] = float('inf')
            for k in range(i, j):
                cost = M[i][k] + M[k + 1][j] + p[i - 1] * p[k] * p[j]
                if cost < M[i][j]:
                    M[i][j] = cost
    return M[1][n]

